import { Link } from 'react-router-dom';
const Adminnav = () => {
    return ( 
        <div className="p-2 bg-light mt-4  ">
     
   <ul class="nav justify-content-center flex-column">
  <li class="nav-item">
    <Link to='/addproduct' className="nav-link  ">Add product</Link>
  </li>
  <li class="nav-item">
    <Link class="nav-link " >All Products</Link>
  </li>
  <li class="nav-item ">
    <Link class="nav-link  ">View Users</Link>
  </li>
 
</ul>
        </div>
     );
}
 
export default Adminnav;
